(1, '<p><strong>Tiến sĩ, Bác sĩ chuyên khoa II Huỳnh Minh Hoàng</strong>\'</p>\n<blockquote>\n<p>Thầy thuốc ưu tú, Bác sĩ chuyên khoa Nội Tim mạch</p>\n</blockquote>\n<p>Nguyên Trưởng khoa Tim mạch, Phó Giám đốc trung tâm Tim mạch Bệnh viện E\nHơn 30 năm kinh nghiệm khám và điều trị các bệnh Tim mạch Nội tổng quát\nBác sĩ nhận khám các bệnh nhân từ 16 tuổi trở lên\nKhám và điều trị</p>\n<ul>\n<li>\n<p>Tăng huyết áp</p>\n</li>\n<li>\n<p>Bệnh mạch vành</p>\n</li>\n<li>\n<p>Bệnh đột quỵ</p>\n</li>\n<li>\n<p>Bệnh suy tim</p>\n</li>\n<li>\n<p>Bệnh lý về cơ tim và màng ngoài tim</p>\n</li>\n</ul>\n<p>Bệnh lý rối loạn về nhịp\nKhám tổng quát cho cá nhân</p>\n<p><img src=\"https://github.com/HuynhMinhHoang/share-image-clinic/blob/main/134537-group-12314.png?raw=true\" alt=\"img\"></p>\n', '**Tiến sĩ, Bác sĩ chuyên khoa II Huỳnh Minh Hoàng**\'\n\n\n\n> Thầy thuốc ưu tú, Bác sĩ chuyên khoa Nội Tim mạch\n\nNguyên Trưởng khoa Tim mạch, Phó Giám đốc trung tâm Tim mạch Bệnh viện E\nHơn 30 năm kinh nghiệm khám và điều trị các bệnh Tim mạch Nội tổng quát\nBác sĩ nhận khám các bệnh nhân từ 16 tuổi trở lên\nKhám và điều trị\n* Tăng huyết áp\n\n* Bệnh mạch vành\n\n* Bệnh đột quỵ\n\n* Bệnh suy tim\n* Bệnh lý về cơ tim và màng ngoài tim\n\nBệnh lý rối loạn về nhịp\nKhám tổng quát cho cá nhân \n\n![img](https://github.com/HuynhMinhHoang/share-image-clinic/blob/main/134537-group-12314.png?raw=true)', 'Nguyên Trưởng khoa Tim mạch, Phó Giám đốc trung tâm Tim mạch Bệnh viện E\nHơn 30 năm kinh nghiệm khám và điều trị các bệnh Tim mạch và Nội tổng quát\nBác sĩ nhận khám các bệnh nhân từ 16 tuổi trở lên', 1, NULL, NULL, '2024-04-20 02:20:29', '2024-04-20 17:25:19'),
